import React, { useState, useEffect } from 'react'; 
import axios from 'axios';

const ResourcesPage = () => {
  const [resources, setResources] = useState([]);
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(true);
  const [file, setFile] = useState(null);
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
console.log([...formData.entries()]);

  // Fetch all resources on component mount
  useEffect(() => {
    const fetchResources = async () => {
      try {
        const token = localStorage.getItem('token');
        if (!token) {
          throw new Error('Access denied. Please log in.');
        }

        const response = await axios.get('http://localhost:8000/resources/all', {
          headers: { Authorization: `Bearer ${token}` },
        });

        if (response.data.resources) {
          setResources(response.data.resources);
        }
      } catch (error) {
        console.error('Error fetching resources:', error.response || error.message);
        setMessage(error.message || 'Error loading resources.');
      } finally {
        setLoading(false);
      }
    };

    fetchResources();
  }, []);

  // Handle file upload
  const handleUpload = async (e) => {
    e.preventDefault();

    if (!file || !title) {
      alert('Please provide a file and a title.');
      return;
    }

    const token = localStorage.getItem('token');
    if (!token) {
      alert('Access denied. Please log in.');
      return;
    }

    const formData = new FormData();
    formData.append('file', file);
    formData.append('title', title);
    formData.append('description', description);

    try {
      const response = await axios.post(
        'http://localhost:8000/resources/upload',
        formData,
        {
          headers: {
            'Content-Type': 'multipart/form-data',
            Authorization: `Bearer ${token}`,
          },
        }
      );

      if (response.data.success) {
        alert('Resource uploaded successfully!');
        setResources([...resources, response.data.resource]);
      } else {
        alert('Failed to upload resource.');
      }
    } catch (error) {
      console.error('Upload error:', error.response || error.message);
      alert('An error occurred while uploading the resource.');
    }
  };

  // Handle sharing file URL
  const handleShare = (fileUrl) => {
    navigator.clipboard.writeText(fileUrl)
      .then(() => {
        alert('File URL copied to clipboard! Share it with others.');
      })
      .catch(() => {
        alert('Failed to copy file URL. Try again.');
      });
  };

  // Handle file download
  const handleDownload = (fileUrl) => {
    window.open(fileUrl, '_blank');
  };

  return (
    <div>
      <h1>All Resources</h1>

      {/* Upload Section */}
      <div>
        <h2>Upload New Resource</h2>
        <form onSubmit={handleUpload}>
          <input
            type="text"
            placeholder="Resource Title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
          <textarea
            placeholder="Description (optional)"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
          />
          <input
            type="file"
            onChange={(e) => setFile(e.target.files[0])}
            required
          />
          <button type="submit">Upload</button>
        </form>
      </div>

      {/* Loading and Message States */}
      {loading && <p>Loading resources...</p>}
      {message && <p style={{ color: 'red' }}>{message}</p>}

      {/* Resource List */}
      <ul>
        {resources.length > 0 ? (
          resources.map((resource) => (
            <li key={resource.resource_id}>
              <strong>{resource.title}</strong>
              <p>Type: {resource.type || 'Unknown'}</p>
              <p>Uploaded on: {new Date(resource.upload_date).toLocaleString()}</p>
              <p>{resource.description}</p>
              {resource.file_url && (
                <div>
                  <button onClick={() => handleDownload(resource.file_url)}>
                    Download File
                  </button>
                  <button onClick={() => handleShare(resource.file_url)}>
                    Share File
                  </button>
                </div>
              )}
            </li>
          ))
        ) : (
          !loading && <p>No resources available.</p>
        )}
      </ul>
    </div>
  );
};

export default ResourcesPage;
